import { Link, Route } from "react-router-dom";
import Home from "./Home";
import ReviewDay from "./ReviewDay";


function App() {
  return (
    <div className="App">
       <Link to="/">Home으로 가기</Link>
      <div style={{
          margin: "40px auto",
          backgroundColor:"lavender",
          maxWidth: "30vh",
          height: "80vh",
          display: "flex",
          flexDirection: "column",
          padding: "40px",
          borderRadius: "20px"
      }}> 
      <Route path="/" exact>
        <Home/>
      </Route>

        {/* <Link to="/reviewday">ReviewDay로 가기</Link> */}
      </div>




      <Route path="/reviewday/:day" exact component={ReviewDay}>
        {/* <ReviewDay/> */}
      </Route>
    </div>
  );
}

export default App;
